import React, {useState} from 'react'
import styled from 'styled-components'

const Button = styled.button`
  width: 50px;
  height: 50px;
  background: black;
`
const Modal = styled.div`
  width: 300px;
  height: 300px;
  background: lightcolar;

`

function CommuModal() {

  const openModal = () => {
    return(
      <>
        <Modal />
      </>
    )
  }

  return (
    <>
      <Button onClick={openModal}/>
    </>
  )
}

export default CommuModal
